import './App.css';

import Sigma from 'react-sigma';
function App() {
  const graph = {
    nodes: [
      { id: 'n1', label: 'Node 1', x: 0, y: 0, size: 10, color: '#ff0000' },
      { id: 'n2', label: 'Node 2', x: 100, y: 100, size: 10, color: '#00ff00' },
    ],
    edges: [
      { id: 'e1', source: 'n1', target: 'n2', label: 'Edge from Node 1 to Node 2' },
    ],
  };
  return (
    <div className="App">
      <header >
      <div style={{backgroundColor:"GrayText", width:600}}>


  <Sigma graph={graph} settings={{ drawEdges: true, drawNodes: true}}>
      <div style={{ height: '1600px',width:"1600px",backgroundColor:"blue" }} />
    </Sigma>
    </div>
      </header>
    </div>
  );
}

export default App;
